import React from "react";
import "./App.css";

const rates = fetch(
  "https://openexchangerates.org/api/latest.json?app_id=37ce05177037491283b06fe29e31e8f3"
)
  .then((res) => res.json()) //response type
  .then((data) => data);

console.log(rates);

async function App() {
  const rates = await fetch(
    "https://openexchangerates.org/api/latest.json?app_id=37ce05177037491283b06fe29e31e8f3"
  );
  console.log(rates);

  return <div className="App"></div>;
}

const btc = 0.1;

export default App;
